import React, { Component } from "react";

export class Form extends Component {
  state = {
    misison: "",
    goal: "",
    outcome: ""
  };
  render() {
    return (
      <div>
        <h1>Add Vision</h1>
      </div>
    );
  }
}

export default Form;
